        var expDate = new Date();
        expDate.setTime(expDate.getTime() + 365 * 24 * 3600 * 1000);
        document.cookie = name + '=' + escape(value) + '; samesite=strict; expires=' + (expires || expDate.toGMTString()) + (path ? '; path=' + path : '; path=/') + (domain ? '; domain=' + domain : '') + (secure ? '; secure' : '');
