OSPViewer.prototype.GetCookie = function (name) {
    var getCookie_ = function (name) {
        var cookie = ' ' + document.cookie;
        var search = ' ' + name + '=';
        var setStr = null;
        var offset = 0;
        var end = 0;
        if (cookie.length > 0) {
            offset = cookie.indexOf(search);
            if (offset != -1) {
                offset += search.length;
                end = cookie.indexOf(';', offset);
                if (end == -1) {
                    end = cookie.length;
                }
                setStr = unescape(cookie.substring(offset, end));
            }
        }
        return setStr;
    };
    if (this.options.standaloneJsMode || typeof localStorage == 'undefined' || name.indexOf('sti_') == 0 || name.indexOf('login') == 0) {
        return getCookie_(name);
    }
    var value = localStorage.getItem(name);
    if (value != null) {
        return value;
    } else {
        value = getCookie_(name);
        if (value != null) {
            this.RemoveCookie(name);
            localStorage.setItem(name, value);
        }
        return value;
    }
};
