OSPViewer.prototype.ReplaceMonths = function (value) {
    for (var i = 1; i <= 12; i++) {
        var enName = '';
        var locName = '';
        switch (i) {
        case 1:
            enName = 'January';
            locName = this.collections.loc.MonthJanuary;
            break;
        case 2:
            enName = 'February';
            locName = this.collections.loc.MonthFebruary;
            break;
        case 3:
            enName = 'March';
            locName = this.collections.loc.MonthMarch;
            break;
        case 4:
            enName = 'April';
            locName = this.collections.loc.MonthApril;
            break;
        case 5:
            enName = 'May';
            locName = this.collections.loc.MonthMay;
            break;
        case 6:
            enName = 'June';
            locName = this.collections.loc.MonthJune;
            break;
        case 7:
            enName = 'July';
            locName = this.collections.loc.MonthJuly;
            break;
        case 8:
            enName = 'August';
            locName = this.collections.loc.MonthAugust;
            break;
        case 9:
            enName = 'September';
            locName = this.collections.loc.MonthSeptember;
            break;
        case 10:
            enName = 'October';
            locName = this.collections.loc.MonthOctober;
            break;
        case 11:
            enName = 'November';
            locName = this.collections.loc.MonthNovember;
            break;
        case 12:
            enName = 'December';
            locName = this.collections.loc.MonthDecember;
            break;
        }
        var enShortName = enName.substring(0, 3);
        var locShortName = locName.substring(0, 3);
        value = value.replace(enName, i).replace(enName.toLowerCase(), i).replace(enShortName, i).replace(enShortName.toLowerCase(), i);
        value = value.replace(locName, i).replace(locName.toLowerCase(), i).replace(locShortName, i).replace(locShortName.toLowerCase(), i);
    }
    return value;
};
OSPViewer.prototype.GetDateTimeFromString = function (value, format) {
    var charIsDigit = function (char) {
        return '0123456789'.indexOf(char) >= 0;
    };
    if (!value)
        return new Date();
    value = this.ReplaceMonths(value);
    var dateTime = new Date();
    if (format == null)
        format = 'dd.MM.yyyy hh:mm:ss';
    var year = 1970;
    var month = 1;
    var day = 1;
    var hour = 0;
    var minute = 0;
    var second = 0;
    var millisecond = 0;
    var char = '';
    var pos = 0;
    var values = [];
    while (pos < value.length) {
        char = value.charAt(pos);
        if (charIsDigit(char)) {
            values.push(char);
            pos++;
            while (pos < value.length && charIsDigit(value.charAt(pos))) {
                values[values.length - 1] += value.charAt(pos);
                pos++;
            }
            values[values.length - 1] = this.StrToInt(values[values.length - 1]);
        }
        pos++;
    }
    pos = 0;
    var charCount = 0;
    var index = -1;
    var is12hour = false;
    while (pos < format.length) {
        char = format.charAt(pos);
        charCount = 0;
        if (char == 'Y' || char == 'y' || char == 'M' || char == 'd' || char == 'h' || char == 'H' || char == 'm' || char == 's' || char == 'f' || char == 'F' || char == 't' || char == 'z') {
            index++;
            while (pos < format.length && format.charAt(pos) == char) {
                pos++;
                charCount++;
            }
        }
        switch (char) {
        case 'Y':
            year = values[index];
            break;
        case 'y':
            if (values[index] < 1000)
                year = 2000 + values[index];
            else
                year = values[index];
            break;
        case 'M':
            month = values[index];
            break;
        case 'd':
            day = values[index];
            break;
        case 'h':
            is12hour = true;
            hour = values[index];
            break;
        case 'H':
            hour = values[index];
            break;
        case 'm':
            minute = values[index];
            break;
        case 's':
            second = values[index];
            break;
        case 'f':
        case 'F':
            millisecond = values[index];
            break;
        case 't':
            if (value.toLowerCase().indexOf('am') >= 0 && hour == 12)
                hour = 0;
            if (value.toLowerCase().indexOf('pm') >= 0 && hour < 12)
                hour += 12;
            break;
        default:
            pos++;
            break;
        }
    }
    dateTime = new Date(year || new Date().getFullYear(), month - 1 || 0, day || 1, hour || 0, minute || 0, second, millisecond || 0);
    if (!dateTime || isNaN(dateTime))
        return new Date();
    return dateTime;
};
