OSPViewer.prototype.GetCommonExportFormat = function (format) {
    if (format == 'Html' || format == 'Html5' || format == 'Mht')
        return 'Html';
    if (format == 'Excel' || format == 'Excel2007' || format == 'ExcelXml')
        return 'Excel';
    if (format == 'Csv' || format == 'Dbf' || format == 'Xml' || format == 'Dif' || format == 'Sylk')
        return 'Data';
    if (format == 'ImageBmp' || format == 'ImageGif' || format == 'ImageJpeg' || format == 'ImagePcx' || format == 'ImagePng' || format == 'ImageTiff' || format == 'ImageEmf' || format == 'ImageSvg' || format == 'ImageSvgz')
        return 'Image';
    return format;
};
OSPViewer.prototype.DropDownListForExportForm = function (name, width, toolTip, items, readOnly, showImage) {
    var dropDownList = this.DropDownList(name, width, toolTip, items, readOnly, showImage);
    dropDownList.onChange = function () {
    };
    dropDownList.setKey = function (key) {
        dropDownList.key = key;
        dropDownList.onChange();
        for (var itemName in dropDownList.items)
            if (key == dropDownList.items[itemName].key) {
                this.textBox.value = dropDownList.items[itemName].caption;
                if (dropDownList.image)
                    dropDownList.image.style.background = 'url(' + dropDownList.jsObject.collections.images[dropDownList.items[itemName].imageName] + ')';
                return;
            }
        dropDownList.textBox.value = key.toString();
    };
    if (dropDownList.menu) {
        dropDownList.menu.action = function (menuItem) {
            this.changeVisibleState(false);
            this.dropDownList.key = menuItem.key;
            this.dropDownList.textBox.value = menuItem.caption.innerHTML;
            if (this.dropDownList.image)
                this.dropDownList.image.style.background = 'url(' + this.jsObject.collections.images[menuItem.imageName] + ')';
            this.dropDownList.onChange();
            this.dropDownList.action();
        };
    }
    return dropDownList;
};
OSPViewer.prototype.InitializeErrorMessageForm = function () {
    var form = this.BaseForm('errorMessageForm', this.collections.loc['Error'], 4);
    form.buttonCancel.style.display = 'none';
    var table = this.CreateHTMLTable();
    form.container.appendChild(table);
    form.image = document.createElement('img');
    form.image.style.boxSizing = 'content-box';
    form.image.style.padding = '15px';
    form.image.style.width = form.image.style.height = '32px';
    form.image.src = this.collections.images['MsgFormError.png'];
    table.addCellInLastRow(form.image);
    form.description = table.addCellInLastRow();
    form.description.className = 'stiJsViewerMessagesFormDescription';
    form.description.style.maxWidth = '600px';
    form.description.style.color = this.options.toolbar.fontColor;
    form.show = function (messageText, messageType) {
        if (this.visible) {
            this.description.innerHTML += '<br/><br/>' + messageText;
            return;
        }
        if (this.jsObject.controls.forms.errorMessageForm) {
            this.jsObject.controls.mainPanel.removeChild(this.jsObject.controls.forms.errorMessageForm);
            this.jsObject.controls.mainPanel.appendChild(this.jsObject.controls.forms.errorMessageForm);
        }
        this.caption.innerHTML = this.jsObject.collections.loc['FormViewerTitle'];
        if (messageType == 'Warning')
            this.image.src = this.jsObject.collections.images['MsgFormWarning.png'];
        else if (messageType == true || messageType == 'Info')
            this.image.src = this.jsObject.collections.images['MsgFormInfo.png'];
        else {
            this.image.src = this.jsObject.collections.images['MsgFormError.png'];
            this.caption.innerHTML = this.jsObject.collections.loc['Error'];
        }
        this.changeVisibleState(true);
        this.description.innerHTML = messageText;
    };
    form.action = function () {
        this.changeVisibleState(false);
    };
    return form;
};
