OSPViewer.prototype.ConvertDateRangeSelectionToDateRangeKind = function (rangeSelection) {
    switch (rangeSelection) {
    case 'DayTomorrow':
        return 'Tomorrow';
    case 'DayToday':
        return 'Today';
    case 'DayYesterday':
        return 'Yesterday';
    case 'WeekNext':
        return 'NextWeek';
    case 'WeekCurrent':
        return 'CurrentWeek';
    case 'WeekPrevious':
        return 'PreviousWeek';
    case 'MonthNext':
        return 'NextMonth';
    case 'MonthCurrent':
        return 'CurrentMonth';
    case 'MonthPrevious':
        return 'PreviousMonth';
    case 'QuarterNext':
        return 'NextQuarter';
    case 'QuarterCurrent':
        return 'CurrentQuarter';
    case 'QuarterPrevious':
        return 'PreviousQuarter';
    case 'QuarterFirst':
        return 'FirstQuarter';
    case 'QuarterSecond':
        return 'SecondQuarter';
    case 'QuarterThird':
        return 'ThirdQuarter';
    case 'QuarterFourth':
        return 'FourthQuarter';
    case 'YearNext':
        return 'NextYear';
    case 'YearCurrent':
        return 'CurrentYear';
    case 'YearPrevious':
        return 'PreviousYear';
    case 'Last7Days':
        return 'Last7Days';
    case 'Last14Days':
        return 'Last14Days';
    case 'Last30Days':
        return 'Last30Days';
    case 'DateToWeek':
        return 'WeekToDate';
    case 'DateToMonth':
        return 'MonthToDate';
    case 'DateToQuarter':
        return 'QuarterToDate';
    case 'DateToYear':
        return 'YearToDate';
    }
    return 'Today';
};
